import React from 'react';
import { Typography } from '@material-ui/core'


const Homepage = () => {
  return <div>
    <Typography varient ='h3'>Fitness Tracker </Typography>
    <img src='https://www.muscleandfitness.com/wp-content/uploads/2018/11/Group-Fitness-Class-Performing-A-Variety-Of-Exercises-1.jpg?quality=86&strip=all' alt='banner'/>
    </div>
}

export default Homepage;
